                    currentCityClimateTD.push(key)
                    currentCityClimateTR.push(value)
                }
            }
            else{
                console.log('failure')
            }
            }
    }

    const getKoppenClimate = (reactCity, currentState) => {
        //grab lat and lon
        const success = async () => {
            const city = reactCity
            const state = ''
            const country = currentState
            if (statesUSA.includes(currentState)){
                state = currentState
                country = 'us'
            }
            const baseURL1 = `https://api.openweathermap.org/geo/1.0/direct?q=${city},${state},${country}&limit=2&appid=3dd6b4b0643fe807a69521e6f5cd399a`

            await axios.get(baseURL1).then((response)=> {
                const lat =  response.data.lat
                const lon = response.data.lon
                console.log(lat,lon)

            });
        }
    }



      // Start the fetch operation as soon as
    // the page loads
    useEffect(() => {
        FetchClimates();
        DisplayData();
        getKoppenClimate();
    }, [currentCity, currentCityClimateTD, currentCityClimateTR, currentState])

    // console.log("currentCityClimate",currentCityClimateTD)
    return (
    <>
        <section id='about'>
        <h3>About</h3>
        <p>Random Latin filler words...</p>
    </section>

    <section id='get-started'>
        <h3>Get Started!</h3>
        <p>Random Latin filler words....</p>

        <div className="column" id="left-column">   
            <div id ='map'>****Map Goes Here****</div>
        </div>

        <p>Select a city and country and get started!</p>

        <select
        onChange={((event) => setcurrentCity(event.target.value))}
        >
        <option>City</option>
        {climate.map((obj) =>(
            <option
                className="item"
                key = {obj.id}
                >
                    {obj.city}
            </option>
        ))}
        </select>
        <br/>
        <br/>


        <div>See Climate Data Here:
            {' ' + currentCity + ',  '+ currentState}
        </div>

        <br/>
