            <p>Winter High: {WinterHigh}</p>
            <p>Winter Low: {WinterLow}</p>

            <p>Spring High: {springHigh}</p>
            <p>Spring Low: {springLow}</p>

            <p>Summer High: {SummerHigh}</p>
